/* eslint-disable no-useless-constructor */
import React, { Component } from 'react'

class App extends Component {
  constructor(props)
  {
    super(props)
    this.state={
      count:0
    }
  }

  clickHandler(){
    console.log(this)
    this.setState({
      count:this.state.count+1
    })
  }

  render() {
    const {count}=this.state
    const li=['rohit','virat','sky','rohit']
    const list=li.map((item)=><li key={item,index}>{}{item}</li>)
    return (

      <div style={{textAlign:"center"}}>

        {/*<button onClick={this.clickHandler.bind(this)}>click</button>*/}
        <button onMouseOver={()=>this.clickHandler()}>{count}</button>
        <ol>
          {/*li.map((item)=><li>{item}</li>)*/}
          {list}
        </ol>

      </div>
    )
  }
}

export default App
